import React, { Component } from "react";
import { withRouter } from "react-router-dom";
import "./Nav.css";
import Dropdown from "../components/Dropdown/Dropdown";
import Axios from "axios";

class Nav extends Component {
  constructor(props) {
    super(props);
    this.state = {
      urllist: []
    };
  }
  render() {
    const {
      match: { params }
    } = this.props;
    fetchUrlsBasedonCatId = categoryId => {
      Axios.post("/api/urls/createUrl/${categoryId}")
        .then(response => {
          console.log(categoryId);
        })
        .catch(error => {
          console.log(error);
        });
    };
    componentDidMount = () => {
      Axios.post("/api/urls/createUrl/${categoryId}")
        .then(response => {
          console.log(categoryId);
        })
        .catch(error => {
          console.log(error);
        });
      fetchUrlsBasedonCatId(params.categoryId);
    };

    return (
      <form className="form">
        <div>
          <h1>List of URLs</h1>
        </div>
        <div>
          <Dropdown
            fetchurls={true}
            fetchUrlsBasedonCatId={fetchUrlsBasedonCatId}
            categoryId={params.categoryId}
          />
        </div>
      </form>
    );
  }
}
export default withRouter(Nav);
